  const {
    openModal,
    setOpenModal,
    players,
    setPlayers,
  } = React.useContext(Context);
  return <React.Fragment>
    {!!openModal &&
     <Modal>
         <Selecion 
          setOpenModal={setOpenModal}

         />
     </Modal>
    }
    <Campo
      players={players}
    />
    </React.Fragment>;
}

export {AppUI};
